- proto: BookBase
  entities:
  - uid: 390
    components:
    - type: MetaData
      desc: Кодекс, который был создан основателями клоунской организации "Цирк и Радостный Край"
      name: Кодекс чести клоуна
    - type: Transform
      pos: 18.406813,-3.3412611
      parent: 2
    - type: Paper
      content: >
        КОДЕКС ПОВЕДЕНИЯ КЛОУНОВ:

        0. ХОНК!

        1. Быть весёлым и смешным(Самое важное у клоунов!)

        2. Клоун клоуна не обижает. Клоун клоуна уважает(помогайте своим братья клоунам и не обижайте их)

        3. Слушать Хонко Матерь и её желания.(Выполняйте ее задания и желательно не заставлять её краснеть за вас!)

        4. Пранки должны быть не убийственными!(цель клоуна смешить а не кромсать в томатный соус людей.)

        5. Воровать-плохо! (Не воруйте со станции вещи. А если взяли на время, то возвращайте через 10 минут максимум. Есть исключения если это экстренная ситуация. )

        6. Не обижать людей на выступлениях!

        7. Будь креативным! (придумывай свои безопасные приколы, шутки, а может даже устраивай конкурсы, люди это любят.)

        8.Вид прежде всего!(Не снимайте свой клоунский мундир. Лишь для выступлений!)

        9.Не мешайте во время  каждых кодов кроме зелёного сотрудникам которым в эти нужно больше работать.(НЕ МЕШАТЬ СБ В:КРАСНЫЙ, СИНИЙ КОД. НЕ МЕШАТЬ МЕДИКАМ В:ФИОЛЕТОВЫЙ КОД. НЕ МЕШАТЬ ИНЖЕНЕРАМ:В ЖЁЛТЫЙ КОД!)

        10.Все Сотрудники Безопасности наши братья клоуны!(ГСБ, варден, детектив в том числе)
